import React, { Component } from "react";
import NavComplete from "../components/navcomplete";

class Newsletter extends Component {
  state = {};
  render() {
    return (
      <div>
        <NavComplete />
        <div style={{ justifyContent: "center" }}>
          <div>Join my newsletter</div>
          <a href="#">Join here</a>
        </div>
      </div>
    );
  }
}

export default Newsletter;
